#===========================================================================
# Functions
#===========================================================================

Function Get-LogonServer {
	
	Try {
		
		(nltest /dsgetdc: | findstr 'DC: ').split(" ") | ForEach-Object {
			
			If ($_ -like '\\*') {
				#DC Found
				$DC = $_.replace('\\', '')
			}
		}
		
	}
	Catch {
		
		$DC = $False #No DC found
		
	}
	
	
	If ($DC) {
		
		#$DC exists
		$DC
		
	}
	Else {
		
		Return "Not connected to a domain"
		
	}
	
	
}
Function Get-ComputerInfo {
    
    # Only query data if form just loaded.  Use cached info if it has already been queried.
    If($Null -eq $ComputerInfoTable) {
        
        # Gather data for PS Table
        $LogonServer = Get-LogonServer
        $IPAddress = ([System.Net.Dns]::GetHostByName(("$env:ComputerName"))).AddressList.IPAddressToString
        If($Null -eq $IPAddress) { $IPAddress = (Get-NetIPConfiguration | Where-Object { $Null -ne $_.IPv4DefaultGateway -and $_.NetAdapter.Status -ne "Disconnected" }).IPv4Address.IPAddress }
        $LastBootUpTime_WMI = Get-CimInstance Win32_OperatingSystem | Select-Object -Exp LastBootUpTime
        
        # Check if fast boot is enabled: if enabled uptime may be wrong (Inspired and taken from https://www.systanddeploy.com/2022/02/a-toast-notification-to-display-warning.html)
        $CheckFastBoot = (Get-ItemProperty "HKLM:\SYSTEM\CurrentControlSet\Control\Session Manager\Power" -ErrorAction SilentlyContinue).HiberbootEnabled

        # If fast boot is not enabled
        If(($Null -eq $CheckFastBoot) -or ($CheckFastBoot -eq 0)) {

		        $BootEvent = Get-WinEvent -ProviderName 'Microsoft-Windows-Kernel-Boot'| Where-Object {$_.ID -eq 27 -and $_.message -like "*0x0*"}

		        If($Null -ne $BootEvent) {

				        $LastBootUpTime_Event = $BootEvent[0].TimeCreated
	
		        }
        }
        ElseIf($CheckFastBoot -eq 1) {

		        $BootEvent = Get-WinEvent -ProviderName 'Microsoft-Windows-Kernel-Boot'| Where-Object {$_.ID -eq 27 -and $_.message -like "*0x1*"}

		        If($Null -ne $BootEvent) {

				        $LastBootUpTime_Event = $BootEvent[0].TimeCreated

		        }
		
        }
        If($Null -eq $LastBootUpTime_Event) {

		        $Uptime = $LastBootUpTime_WMI

        }
        Else {

		        If($LastBootUpTime_WMI -ge $LastBootUpTime_Event) {

				        $Uptime = $LastBootUpTime_WMI

		        }
		        Else {

				        $Uptime = $LastBootUpTime_Event

		        }

        }

        # Determine Model Information
        $Make = (Get-CIMInstance Win32_BIOS).Manufacturer

        # Computer Model
        If($Make -eq "Lenovo") {

            $Model = (Get-CIMInstance -Class Win32_ComputerSystemProduct).Version

        }
        Else {

            $Model = (Get-CIMInstance -Class Win32_ComputerSystem).Model

        }
        # Get wireless information
        $WirelessNetworkInfo = netsh wlan show interfaces

        # Create tables
        If($WirelessNetworkInfo -match '^\s+SSID') {

            $script:ComputerInfoTable = New-Object PSObject -Property @{
	
	            "Hostname" = "$env:COMPUTERNAME"
	            "Hardware Model" = $Model
	            "Hardware Serial" = (Get-CIMInstance Win32_ComputerSystemProduct).IdentifyingNumber
                "SSID" = ($WirelessNetworkInfo -Match '^\s+SSID' -Replace '^\s+SSID\s+:\s+','')[0]
                "Wireless Signal" = ($WirelessNetworkInfo -Match '^\s+Signal' -Replace '^\s+Signal\s+:\s+','')[0]
	            "Domain Controller" = $LogonServer -creplace '\..*'
	            "OS Build" = (Get-CIMInstance Win32_OperatingSystem -Property *).Caption + " " + (Get-ItemProperty "HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion").DisplayVersion
	            "OS Install Date" = (Get-CIMInstance Win32_OperatingSystem -Property InstallDate).InstallDate
	            "Last Reboot" = $Uptime
	
            }

        }
        Else {

            $script:ComputerInfoTable = New-Object PSObject -Property @{
	
	            "Hostname" = "$env:COMPUTERNAME"
	            "Hardware Model" = $Model
	            "Hardware Serial" = (Get-CIMInstance Win32_ComputerSystemProduct).IdentifyingNumber
                "SSID" = "N/A"
                "Wireless Signal" = "N/A"
	            "Domain Controller" = $LogonServer -creplace '\..*'
	            "OS Build" = (Get-CIMInstance Win32_OperatingSystem -Property *).Caption + " " + (Get-ItemProperty "HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion").DisplayVersion
	            "OS Install Date" = (Get-CIMInstance Win32_OperatingSystem -Property InstallDate).InstallDate
	            "Last Reboot" = $Uptime
	
            }


        }

        # Account for multiple IP addresses
        If($IPAddress.Count -gt 1) {

            $IPAddressCounter = 0

            ForEach($IP in $IPAddress) {

                Add-Member -MemberType NoteProperty -InputObject $ComputerInfoTable -Name "IP Address($IPAddressCounter)" -Value $IP
                $IPAddressCounter ++

            }
            $IPAddressArray = ($ComputerInfoTable.PSObject.Properties.Name | Where-object {$_ -like "IP Address*" })

            $script:ComputerInfoTable = $ComputerInfoTable | Select-Object (Write-Output "Hostname" "Hardware Model" "Hardware Serial" $IPAddressArray "SSID" "Wireless Signal" "Domain Controller" "OS Build" "OS Install Date" "Last Reboot")
        }
        Else {

            Add-Member -MemberType NoteProperty -InputObject $ComputerInfoTable -Name "IP Address" -Value $IPAddress
            $script:ComputerInfoTable = $ComputerInfoTable | Select-Object "Hostname", "Hardware Model", "Hardware Serial", "IP Address", "SSID", "Wireless Signal", "Domain Controller", "OS Build", "OS Install Date", "Last Reboot"

        }

    }
    Else {

        # Reorganize About Me when data has already been queried
        If(($ComputerInfoTable.PSObject.Properties | Where-Object { $_.Name -like "IP Address*" }).Count -gt 1) {

            $IPAddressArray = ($ComputerInfoTable.PSObject.Properties.Name | Where-object {$_ -like "IP Address*" })
            $script:ComputerInfoTable = $ComputerInfoTable | Select-Object (Write-Output "Hostname" "Hardware Model" "Hardware Serial" $IPAddressArray "SSID" "Wireless Signal" "Domain Controller" "OS Build" "OS Install Date" "Last Reboot")

        }
        Else {
            
            $script:ComputerInfoTable = $ComputerInfoTable | Select-Object "Hostname", "Hardware Model", "Hardware Serial", "IP Address", "SSID", "Wireless Signal", "Domain Controller", "OS Build", "OS Install Date", "Last Reboot"

        }

    }

    $WPF_AboutMe_TextBox.Text = ""

    # Update TextBlock
    $ComputerInfoTable.PSObject.Properties  | ForEach-Object {
    
        # Inspired by https://github.com/kunaludapi/Powershell/blob/master/Powershell%20GUI%20format%20text/Format-TextFomattingOnGUi.ps1
        $ObjRun = New-Object System.Windows.Documents.Run
        $ObjRun.Text = $($_.Name + " : ")
        $ObjRun.FontWeight = "Bold"
        $WPF_AboutMe_TextBox.Inlines.Add($ObjRun)
        $WPF_AboutMe_TextBox.Inlines.Add($(($_.Value | Out-String).Trim() + "`n"))

    }

}
Function Get-Tools {

        # Update TextBlock
        ($JSONTools.PSObject.Properties | Where-Object { $_.TypeNameOfValue -eq "System.Object" }).Value | ForEach-Object {

            # Inspired by https://github.com/kunaludapi/Powershell/blob/master/Powershell%20GUI%20format%20text/Format-TextFomattingOnGUi.ps1
            $script:ObjRun = New-Object System.Windows.Documents.Run
            $ObjRun.Text = ([char]0x2022 + " " + $_.Name + "`n")

            $Process = $_.Process
            $Argument = $_.Argument
            
            If($_.Header -eq $False -and $_.Argument -ne $False) {
                
                $ObjRun.Cursor = "Hand" 
                $ObjRun.Tag = $Process + " " + $Argument

                $ObjRun.Add_MouseDown{param($ObjRun)

                    Start-Process ($ObjRun.Tag -replace "\s.*").Trim() -ArgumentList ($ObjRun.Tag -replace "^([^\s]+)\s+")

                }
                $ObjRun.Add_MouseEnter{param($ObjRun) $ObjRun.Foreground = "$ToolsTextRollover" }
                $ObjRun.Add_MouseLeave{param($ObjRun) $ObjRun.Foreground = "$ToolsTextForeground" }

            }
            ElseIf($_.Header -eq $False -and $_.Argument -eq $False) {
                
                $ObjRun.Cursor = "Hand"
                $ObjRun.Tag = $Process

                $ObjRun.Add_MouseDown{param($ObjRun)

                    Start-Process $ObjRun.Tag

                }
                $ObjRun.Add_MouseEnter{param($ObjRun) $ObjRun.Foreground = "$ToolsTextRollover" }
                $ObjRun.Add_MouseLeave{param($ObjRun) $ObjRun.Foreground = "$ToolsTextForeground" }

            }
            Else { $ObjRun.Text = ($_.Name + "`n") ; $ObjRun.FontWeight = "Bold" ; $ObjRun.FontSize = "15"   }
            
            $WPF_AboutMe_TextBox.Inlines.Add($ObjRun)

        }

}

