    ($script:ComputerInfoTable | Out-String).Trim() | Clip

    # Create Outlook draft
    If($OutlookInstalled -eq $True) {

        Start-Process Powershell.exe -ArgumentList "-NoProfile -Command `"& {Write-Host `"Generating Email...`"; `$Outlook` = New-Object -ComObject Outlook.Application;`$Mail` = `$Outlook`.CreateItem(0);`$Mail`.Subject = `"'$env:COMPUTERNAME - Support Request`"';`$Mail`.Body = `"'$(($script:ComputerInfoTable | Out-String).Trim().ToString())`"';`$Mail`.Save();`$Inspector` = `$Mail`.GetInspector;`$Inspector`.Display()}`""
    
    }

}

